export default {
    // 更新克隆网页的状态
    updateClonePage(state, input) {
        switch (input.type) {
            case 'init':
                state.clonePage = input.data
                break
            case 'clean':
                state.clonePage = input.data
                break
            default:
                // nothing
        }
    },
    // 更新克隆网页到cloneId
    updateCloneId(state, input) {
        state.cloneId = input
    },
    // 弹出层handel
    updateComponentCate(state, data) {
        state.componentCate = data
    },
    // 更新名片组件信息
    updateCardInfo(state, data) {
        state.cardInfo = data
    },
    // footer的显示隐藏
    updateSelectShow(state, data) {
        state.selectShow = data
    },
    // 模板保存
    updateTempDatas(state, data) {
        state.tempDatas = data
    },
    // 时候编辑视频
    updateEditVideo(state, data) {
        state.editVideo = data
    },
    // 视频索引
    updateVideoIndex(state, data) {
        state.videoIndex = data
    },
    // 是否点击购买
    updatePreviewGoods(state, data) {
        state.previewGoods = data
    },
}
